def adi_part8(
    n: int, X: List[List[int]], A: List[List[int]], B: List[List[int]]
) -> List[List[int]]:
    return matrix_row_slice(
        matrix_where(
            matrix_row_slice(X, 0, n - 2),
            matrix_elemwise_div(
                matrix_elemwise_sub(
                    matrix_row_slice(X, 2, n),
                    matrix_elemwise_mul(
                        matrix_row_slice(X, 1, n - 1), matrix_row_slice(A, 0, n - 3)
                    ),
                ),
                matrix_row_slice(B, 0, n - 2),
            ),
            lambda x, y: x // y,
        ),
        0,
        n - 2,
    )
